import Home from "../pages/home/home";
import weapons from "../pages/weapons/weapons";

import { Navigate } from "react-router-dom";

const routes = [
  {
    path: "/home",
    element: <Home />,
  },
  {
    path: "/home",
    element: <weapons />,
  },
  {
    path: "/*",
    element: <Navigate to="/home" />,
  },
];
export default routes
